script: |
  super -f tsv -I q99.sql | sort > q99.out

vector: true

inputs:
  - name: q99.sql
    data: |
      SELECT DISTINCT tab0.col1 / + ( col2 ) + + CAST ( ( + col1 ) + + ( col0 ) AS REAL ) * + tab0.col1 FROM tab0;
  - name: tab0

outputs:
  - name: q99.out
    data: |
      12901
      16381
      9462
